angular.module('starter.services')

    .service('DatabaseService', function ($http) {
        
        document.addEventListener("deviceready", dbReady, false);
        //alert('database')
		//var db = window.sqlitePlugin.openDatabase({name: "my.db"});
        
        function dbReady () {
            var db = window.sqlitePlugin.openDatabase({name: "my.db"});
            //var db = openDatabase("nicky3db", "01", "nicky3", 5 *1024*1024);
            
            var url = 'http://app.nicky3.com/AppApis/apiMaps.asp';
            $http.jsonp(url, {
                params: {
                    callback: 'JSON_CALLBACK',
                    format:'json'
                }
            }). 
            success (function(data){   
                    databaseCall(data)
            })
            
            function databaseCall (data) {
                db.transaction(function (tx) { 
                    tx.executeSql('DROP TABLE IF EXISTS tMaps');
                    tx.executeSql('CREATE TABLE IF NOT EXISTS tMaps (RecID integer, Name text, Image text, Description text)');
                    
                    for (var key in data) {
                        if (data.hasOwnProperty(key)) {
                            RecID = data[key].RecID 
                            Name = data[key].Name
                            Image = "data:image/png;base64,"
                            Description = data[key].Description
                            
                            //console.log("RecID: " + RecID + " -- Name: " + Name + " -- Image: " + Image + " -- Description: " + Description)
                            tx.executeSql("INSERT INTO tMaps (RecID, Name, Image, Description) VALUES (?,?,?,?)", [RecID, Name, Image, Description])
                        }
                    }
                })    
            }
        }
});

